import React from 'react';
import Faker from 'faker';

import './vehicle.css';

class Vehicles extends React.Component {
    render () {
        return (
            <div className='vehicle-main-div'>
                <img alt="Vehicle" src={Faker.image.transport(500, 500)}/>
                <p>2019 Subaru Legacy</p>
                <p>Automatic</p>
                <p>999,999km</p>
                <p>$99,000</p>
            </div>
        )
    }
}

export default Vehicles;
